import styled from 'styled-components'

let Flex = styled.div`

    display: flex;
        justify-content:center;
        align-items:center;
        flex-direction:column;

`
let Title = styled.h1`
    font-size: 3rem;
    color: #fff;
    margin: 0 auto;
    background:transparent;
`
let Cblock = styled.div`
    margin: 5rem auto;
    max-width: 600px;
    height:600px;
    width: 100%;
    display:flex;
    flex-direction:column;

    border-radius:15px;
`

let Clmn = styled.div`
margin: 40px auto;
    display:flex;
    background:transparent;


`
let NewForm = styled.form`
    background-color:transparent;
    display:flex;
    flex-direction:column;
`

let MyInput = styled.input`
    width: 20rem;
    height: 2.5rem;
    font-size:1rem;
    color:#fff;
    border:2px solid #6066FF;
    outline:none;
    border-radius:15px;
    padding: 0 1rem;
    position: relative;
`
let ForInput = styled.div`
    background: transparent;
    margin-bottom: 20px;
`
let Btn = styled.button`

    width:12rem;
    height:3rem;
    background-color:#6066ff;
    border-radius:50px;
    margin: 0 auto;
    outline:none;
    border: none;
    cursor: pointer;
    font-size: 1.3rem;
`
let Show = styled.button`
     outline:none;
    border: none;
    color:#fff;
    position: absolute;
    right: 20px;
`

export default function Register() {
  return (
    <Flex>
<Cblock>
<Title>Register</Title>
<Clmn>
<NewForm >
            <ForInput>
